// src/data/sportsList.js
const sportsList = [
  { id: 1, name: "Football", type: "team", icon: "Football" },
  { id: 2, name: "Basketball", type: "team", icon: "Basketball" },
  { id: 3, name: "Boxing", type: "individual", icon: "BoxingGlove" },
  { id: 4, name: "100m Running", type: "individual", icon: "Run" },
  { id: 5, name: "Volleyball", type: "team", icon: "Volleyball" },
  { id: 6, name: "Table Tennis", type: "individual", icon: "Table" },
  { id: 7, name: "Badminton", type: "individual", icon: "Badminton" },
  { id: 8, name: "Cricket", type: "team", icon: "Cricket" },
  // ...add more as needed!
];
export default sportsList;
